import { Component } from "react";
const styles = {
    sections: {
        height: '60px',
        backgroundColor: '#834841',
        marginTop: '130px',
        display: 'flex',
        flexDirection:'row'

    }
}

class Sections extends Component{
    render() {
        return (
            <div style={styles.sections}>
                <ul>
                    <li>Nuestra Historia</li>
                    <li>Nuestros productos</li>
                </ul>
            </div>
        )
    }
}
export default Sections
